import React from "react";
import { Flag, Segment } from "semantic-ui-react";
import newspaper from "./src/newspaper.png";
import weather from "./src/weather.png";
import twitter from "./src/twitter.png";
import youtube from "./src/youtube.png";

/* import "./globalStyle.css"; */

class Cell extends React.Component {
  render() {
    const obj = { code: "ca", name: "Canada" };
    const { code, name } = obj;
    return (
      <Segment>
        <Flag name={code} />
        <div id={`fuso_${code}`} />
        <h5>{name}</h5>
        <div className="row">
          <img
            id="canada_news"
            src={newspaper}
            className="api_icon news"
            alt="icon_newspaper"
          />
          <img
            id="weather_ca"
            /* onClick="weather(45.376296, -75.651582)" */
            className="api_icon"
            src={weather}
            alt="weather_icon"
          />
          <img
            id="twitter_ca"
            /* onClick="twitter(45.376296, -75.651582)" */
            className="api_icon"
            src={twitter}
            alt="icon_twitter"
          />
          <img
            id="youtube_ca"
            /* onClick="youtube('ca')" */
            className="api_icon"
            src={youtube}
            alt="icon_youtube"
          />
        </div>
      </Segment>
    );
  }
}

export default Cell;
